import React from "react";
import articleContent from "./article-content";

const ArticleList = () => (
  <React.Fragment>
    <header>
      <h1>Articles</h1>
      {articleContent.map((article) => (
        <h3>{article.title}</h3>
      ))}
    </header>
  </React.Fragment>
);

export default ArticleList;
